INSERT INTO `games` VALUES (1,'ett_liv','Här har du ett liv','img/ettliv.png','Kryptisk beskrivning av ett djur.<br />Det gäller att identifiera det djur det handlar om.','Tävlingen gick, tillsammans med tävlingen \"Snål information om person\", under namnet \"Snålskjutsen\" som sommartävling i Sydsvenskan 1981. Man tävlade om 10 resor till Skottland för två personer.','Skriv ditt svar i rutan. När du skriver rätt svar får du en ny uppgift.<br />Totalt finns det 14 uppgifter. Lycka till!','Vill du ha en ledtråd så fråga mig gärna eller skriv ett inlägg på<br />Bertils klurigheter.',NULL,NULL),(2,'person','Snål information om person',NULL,'Den givna informationen leder till en känd person - som kan vara en nu levande person, en historisk sådan men också en figur från sago- eller seriesammanhang.','Tävlingen gick, tillsammans med tävlingen \"Här har du ett liv\", under namnet \"Snålskjutsen\" som sommartävling i Sydsvenskan 1981. Man tävlade om 10 resor till Skottland för två personer. Tänk på att vissa av personerna var aktuella runt 1981 och inte är lika kända idag.','Skriv ditt svar i rutan. När du skriver rätt svar får du en ny uppgift.<br />Totalt finns det 14 uppgifter. Lycka till!','Vill du ha en ledtråd så fråga mig gärna eller skriv ett inlägg på<br />Bertils klurigheter.',NULL,NULL),(3,'dubbelnoten','Dubbelnöten',NULL,'Det gäller dels att lura ut namnet på en viss svensk ort, dels att bestämma en växt. I uppgiften ställs ni inför en \"omformulerad ort\" och en \"kryptisk fanerogam\". Orten och växten har för övrigt en gemensam nämnare: växten är karakteristisk för det landskap där orten ligger och är i flertalet fall s.k. landskapsblomma.','Tävlingen gick som sommartävling i Sydsvenskan 1982. Man tävlade om 20 resor till Berlin för två personer.','Skriv dina svar i rutorna. När du skrivit rätt svar på både ort och växt får du en ny uppgift.<br />Totalt finns det 28 uppgifter. Lycka till!','Vill du ha en ledtråd så fråga mig gärna eller skriv ett inlägg på<br />Bertils klurigheter.',NULL,NULL),(4,'fragvisan','Frågvisan',NULL,'Här testas dina kunskaper kring visor, sånger, kupletter, operetter osv. - i samtliga fall gamla pålitliga örhängen. Identifiera en sång, en visa eller vad det kan vara, med hjälp av en kryptisk beskrivning som syftar på titeln eller innehållet.','Tävlingen gick som sommartävling i Sydsvenskan 1983. Man tävlade om 20 resor till Paris för två personer.','Skriv ditt svar i rutan. När du skriver rätt svar får du en ny uppgift.<br />Totalt finns det 28 uppgifter. Lycka till!','Vill du ha en ledtråd så fråga mig gärna eller skriv ett inlägg på<br />Bertils klurigheter.',NULL,NULL),(5,'sommarcharaden','Sommarcharaden',NULL,'Att lösa charader är en gammal lek som går ut på att finna fram till ett ord med hjälp av rimmande häntydningar.<br />Övningsexempel:<br />Mitt första är husets högsta parti.<br />Mitt andra med matte kopplat kan bli.<br />Mitt hela kan klaras med strategi.<br />Svar:Taktik','Tävlingen gick som sommartävling i Sydsvenskan 1990. Man tävlade om 10 midjeväskor och 10 uppblåsbara nackstöd.','Skriv ditt svar i rutan. När du skriver rätt svar får du en ny uppgift.<br />Totalt finns det 28 uppgifter. Lycka till!','Vill du ha en ledtråd så fråga mig gärna eller skriv ett inlägg på<br />Bertils klurigheter.',NULL,NULL),(6,'dubbelordet','Dubbelordet',NULL,'Det gäller att med hjälp av ledtrådar finna ett ord som har två betydelser. Exempel:<br />Sådan blick man kanske ser<br />eller<br />Någonting som finns längst ner<br />Svar: Tårad','Tävlingen gick som sommartävling i Sydsvenskan 1991. I varje uppgift tävlade man om 1 axelremsväska, 5 sommarparaplyer och 5 picknickmuggar.','Skriv ditt svar i rutan. När du skriver rätt svar får du en ny uppgift.<br />Totalt finns det 36 uppgifter. Lycka till!','Vill du ha en ledtråd så fråga mig gärna eller skriv ett inlägg på<br />Bertils klurigheter.',NULL,NULL),(7,'ordvandningen','Ordvändningen',NULL,'Här söks ett ord som när det läses baklänges blir ett annat ord (t.ex. åt-tå). En ledtråd i vardera riktningen ges.','Tävlingen gick som sommartävling i Sydsvenskan 1992. I prispotten fanns seglarsäckar, shoppingkassar, strandkuddar, handledsbörsar och nyckelringar.','Skriv ditt svar i rutan. När du skriver rätt svar får du en ny uppgift.<br />Totalt finns det 36 uppgifter. Lycka till!','Vill du ha en ledtråd så fråga mig gärna eller skriv ett inlägg på<br />Bertils klurigheter.',NULL,NULL),(8,'ordleken','Ordleken',NULL,'Uppgiften i Ordleken är att identifiera ett antal rätt vanliga svenska ordspråk bakom lika många snåriga formuleringar.','Tävlingen gick som sommartävling i Sydsvenskan 1984 och tjugo Norgeresor låg i vinstpotten.','Skriv ditt svar i rutan. När du skriver rätt svar får du en ny uppgift.<br />Totalt finns det 28 uppgifter. Lycka till!','Vill du ha en ledtråd så fråga mig gärna eller skriv ett inlägg på<br />Bertils klurigheter.',NULL,NULL),(9,'sommarsagan','Sommarsagan',NULL,'Här ska du lura ut vilka sagor eller sagofigurer jag syftar på i mer eller mindre ”mystiska” rubriker. ','Tävlingen gick som sommartävling i Sydsvenskan 1985 och tjugo Londonresor stod på spel.','Skriv ditt svar i rutan. När du skriver rätt svar får du en ny uppgift.<br />Totalt finns det 28 uppgifter. Lycka till!','Vill du ha en ledtråd så fråga mig gärna eller skriv ett inlägg på<br />Bertils klurigheter.',NULL,NULL),(10,'kandisjakten','Kändisjakten',NULL,'I Kändisjakten gäller det att lura ut vilka välkända personer &mdash; nu levande, historiska eller uppdiktade &mdash; som döljer sig bakom ett antal kryptiska, kortfattade beskrivningar.<br />Tänk på att formuleringarna skrevs 1986 och vissa kändisar (eller beskrivningar av dem) som var aktuella då kanske inte är det idag.','Tävlingen gick som sommartävling i Sydsvenskan 1986 och i vinstpotten fanns bland annat tio resor för två personer till Moseldalen. ','Skriv ditt svar i rutan. När du skriver rätt svar får du en ny uppgift.<br />Totalt finns det 28 uppgifter. Lycka till!','Vill du ha en ledtråd så fråga mig gärna eller skriv ett inlägg på<br />Bertils klurigheter.',NULL,NULL);
